[Babes] Melody Jordan (Merry Melody / 19.07.13)

Do you wanna read that magazine or play with me? Tell you what, I'll sit on your lap and we'll talk about the first thing that pops up , OK! Well, since you put it that way... Melody manages to take Kris' mind of his literary pursuits as she lavishes her attention on his tumescent shaft. Not to be outdone, Kris shows his appreciation of her talents by returning the favor. Needless to say the final chapter is dripping wet.

Straight, Gonzo

